import React, { useState } from "react";
import "./App.css";

function App() {
  const [bold, setBold] = useState(false);
  const [italic, setItalic] = useState(false);
  const [underline, setUnderline] = useState(false);
  const [fontSize, setFontSize] = useState("16px");
  const [color, setColor] = useState("#000000");

  const toggleBold = () => setBold(!bold);
  const toggleItalic = () => setItalic(!italic);
  const toggleUnderline = () => setUnderline(!underline);
  const changeFontSize = () => {
    const newSize = prompt("Enter font size (in px):", fontSize);
    if (newSize) setFontSize(`${parseInt(newSize)}px`);
  };
  const changeColor = () => {
    const newColor = prompt("Enter color:");
    if (newColor) setColor(newColor);
  };

  return (
    <div className="App">
      <div className="grid-container">
        <div className="grid-item">
          <button onClick={toggleBold}>Bold</button>
          <button onClick={toggleItalic}>Italic</button>
          <button onClick={toggleUnderline}>Underline</button>
          <button onClick={changeFontSize}>Font-size</button>
          <button onClick={changeColor}>Color</button>
        </div>
        <div
          className="grid-item sentence"
          style={{
            fontWeight: bold ? "bold" : "normal",
            fontStyle: italic ? "italic" : "normal",
            textDecoration: underline ? "underline" : "none",
            fontSize: fontSize,
            color: color,
          }}
        >
          He's not the sharpest knife in the drawer.
        </div>
      </div>
      <div className="grid-container">
        <div className="grid-item">
          <button onClick={toggleBold}>Bold</button>
          <button onClick={toggleItalic}>Italic</button>
          <button onClick={toggleUnderline}>Underline</button>
          <button onClick={changeFontSize}>Font-size</button>
          <button onClick={changeColor}>Color</button>
        </div>
        <div
          className="grid-item sentence"
          style={{
            fontWeight: bold ? "bold" : "normal",
            fontStyle: italic ? "italic" : "normal",
            textDecoration: underline ? "underline" : "none",
            fontSize: fontSize,
            color: color,
          }}
        >
          The big building was blazing with lights.
        </div>
      </div>
      <div className="grid-container">
        <div className="grid-item">
          <button onClick={toggleBold}>Bold</button>
          <button onClick={toggleItalic}>Italic</button>
          <button onClick={toggleUnderline}>Underline</button>
          <button onClick={changeFontSize}>Font-size</button>
          <button onClick={changeColor}>Color</button>
        </div>
        <div
          className="grid-item sentence"
          style={{
            fontWeight: bold ? "bold" : "normal",
            fontStyle: italic ? "italic" : "normal",
            textDecoration: underline ? "underline" : "none",
            fontSize: fontSize,
            color: color,
          }}
        >
          Now you must answer some big questions.
        </div>
      </div>
      <div className="grid-container">
        <div className="grid-item">
          <button onClick={toggleBold}>Bold</button>
          <button onClick={toggleItalic}>Italic</button>
          <button onClick={toggleUnderline}>Underline</button>
          <button onClick={changeFontSize}>Font-size</button>
          <button onClick={changeColor}>Color</button>
        </div>
        <div
          className="grid-item sentence"
          style={{
            fontWeight: bold ? "bold" : "normal",
            fontStyle: italic ? "italic" : "normal",
            textDecoration: underline ? "underline" : "none",
            fontSize: fontSize,
            color: color,
          }}
        >
          Get Your Act Together!
        </div>
      </div>
    </div>
  );
}

export default App;
